<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Admin Panel - Investment Platform</title>
    <!-- Tailwind CSS CDN -->
    <script src="https://cdn.tailwindcss.com"></script>
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&display=swap" rel="stylesheet">
    <style>
        body {
            font-family: 'Inter', sans-serif;
            background-color: #f0f2f5;
            color: #333;
        }
        .container {
            max-width: 960px; /* Wider for admin panel */
            margin: 0 auto;
            min-height: 100vh;
            display: flex;
            flex-direction: column;
            background-color: #fff;
            box-shadow: 0 0 10px rgba(0,0,0,0.1);
        }
        .sidebar {
            width: 250px;
            background-color: #2d3748; /* Darker sidebar */
            color: #cbd5e0;
            padding: 1rem;
            flex-shrink: 0;
        }
        .sidebar-item {
            padding: 0.75rem 1rem;
            margin-bottom: 0.5rem;
            border-radius: 0.5rem;
            cursor: pointer;
            transition: background-color 0.2s, color 0.2s;
            display: flex;
            align-items: center;
        }
        .sidebar-item:hover {
            background-color: #4a5568;
            color: #fff;
        }
        .sidebar-item.active {
            background-color: #4299e1; /* Blue for active */
            color: #fff;
            font-weight: 600;
        }
        .sidebar-item svg {
            margin-right: 0.75rem;
            width: 20px;
            height: 20px;
        }
        .main-content-admin {
            flex-grow: 1;
            padding: 1.5rem;
            overflow-y: auto; /* Allow scrolling for content */
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-top: 1rem;
        }
        th, td {
            border: 1px solid #e2e8f0;
            padding: 0.75rem;
            text-align: left;
        }
        th {
            background-color: #edf2f7;
            font-weight: 600;
            color: #2d3748;
        }
        tr:nth-child(even) {
            background-color: #f7fafc;
        }
        .action-btn {
            padding: 0.4rem 0.8rem;
            border-radius: 0.375rem;
            font-size: 0.875rem;
            font-weight: 500;
            transition: background-color 0.2s;
        }
        .action-btn.approve { background-color: #38a169; color: white; }
        .action-btn.approve:hover { background-color: #2f855a; }
        .action-btn.reject { background-color: #e53e3e; color: white; }
        .action-btn.reject:hover { background-color: #c53030; }
        .action-btn.edit { background-color: #3182ce; color: white; }
        .action-btn.edit:hover { background-color: #2c5282; }
        .action-btn.delete { background-color: #e53e3e; color: white; }
        .action-btn.delete:hover { background-color: #c53030; }
    </style>
</head>
<body class="bg-gray-100">
    <div id="app" class="container">
        <!-- Admin Login Page -->
        <section id="admin-auth-page" class="flex-grow flex items-center justify-center p-4">
            <div class="w-full max-w-md bg-white p-6 rounded-lg shadow-md">
                <h2 class="text-2xl font-semibold text-center mb-6 text-gray-800">Admin Login</h2>
                <form id="admin-login-form" class="space-y-4">
                    <div>
                        <label for="admin-username" class="block text-sm font-medium text-gray-700 mb-1">Email (Admin Username)</label>
                        <input type="email" id="admin-username" name="username" class="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 sm:text-sm" placeholder="admin@example.com" required>
                    </div>
                    <div>
                        <label for="admin-password" class="block text-sm font-medium text-gray-700 mb-1">Password</label>
                        <input type="password" id="admin-password" name="password" class="mt-1 block w-full px-4 py-2 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500 sm:text-sm" placeholder="********" required>
                    </div>
                    <button type="submit" class="w-full py-3 px-4 border border-transparent rounded-md shadow-sm text-lg font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 transition-all duration-300">Login as Admin</button>
                </form>
            </div>
        </section>
